import React from 'react';

import { Col, Card, CardTitle, CardHeader, CardBody } from 'reactstrap';
import { Container } from 'reactstrap';
import { Row } from 'reactstrap';

import TableUI from '../components/TableUI/TableUI';

import axios from 'axios';

import '../assets/scss/layout.scss';
import '../assets/scss/card.scss';

class Homepage extends React.Component {
    constructor() {
        super();
        this.state = {
            ownedChangesTitles: [],
            ownedChangesTasks: [[], []],
            assignedChangesTitles: [],
            assignedChangesTasks: [[], []],
            oncallTitles: [],
            oncallSchedule: [[], []],
            loading: true
        };
    }

    componentDidMount() {
        let path = window.location.pathname;
        axios
            .get("/api" + path)
            .then((response) => {
                return response.data.homepage;
            })
            .then((data) => {
                console.log(data);
                this.setState({
                    ownedChangesTitles: data[1].owned_changes[0].titles,
                    ownedChangesTasks: data[1].owned_changes[1].tasks,
                    assignedChangesTitles: data[0].assigned_changes[0].titles,
                    assignedChangesTasks: data[0].assigned_changes[1].tasks,
                    loading: false
                });
            })
            .catch((error) => console.log(error));
        axios.get("/api/users").then((response) => console.log(response.data));
    }

    render() {
        return (
            <div className="mainSection">
                <Container>
                    <Row className="row-2">
                        <Col className="col-12">
                            <Card className="contact-block">
                                <CardHeader>
                                    <CardTitle>
                                        End User Suite Team
                                    </CardTitle>
                                </CardHeader>
                                <CardBody>
                                    <div className="half-card">
                                        <br />
                                        <b>Arevik Benavidez Torosyan</b>
                                        <p>Analyst</p>
                                        <br></br>
                                        <b>Junaid Javed</b>
                                        <p>Front-End Development</p>
                                        <br></br>
                                        <b>Madeline Hulcy</b>
                                        <p>Back-End Development</p>
                                        <br></br>
                                        <b>Noah Kalinowski</b>
                                        <p>Back-End Development</p>
                                        <br></br>
                                        <b>Sally Ben</b>
                                        <p>Front-End Development</p>
                                    </div>
                                </CardBody>
                            </Card>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Homepage;
